import React from 'react';
import twittericon from "./twitter.svg"

const Quotes= () => {
  return (
    <div id="quote-box">
      <div id="text">
        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut cursus nibh enim, et vehicula velit aliquam id. Aliquam erat volutpat. Praesent sed volutpat massa. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia curae;
        </p>
      </div>
        <div id="author">
          <p>-Tharun</p>
        </div>
        <div id="buttons">
          <a href='#' id="tweet-quote">
            <span><img src=''></img></span>
          </a>
          <button id="new-quote">NewQuote</button>

        </div>
    </div>
  )
}
export default Quotes;
